import './Bgnobg.css';

import React , {useState, useRef} from 'react';
 


function Bgnobg() {

    const inputElement = useRef();

    function choose_color_input() {
        inputElement.current.click();
    }


    return (
            <div>
                    <div className="Bgnobg_text">אל תשכחו להוריד את הקבצים. הם ימחקו אוטומטית כשתצא מהדף </div>
        
                    <div className="bg_color_div" onClick={choose_color_input}> צבע רקע </div>
                    <input type="color" ref={inputElement}  style={{ display: 'none'}}/>

            </div>

        )
}

export default Bgnobg;
